import React from 'react'
import { Table } from 'reactstrap';
const TableRoll = () => {
    return (
        <tbody>
          <tr>
             <td>Mark</td>
             <td>Otto</td>
         </tr>
        </tbody>
    )
}

export default TableRoll;
